char *yWri_TextFile(void  * C)
{
  int i=0;
  FILE *temp = *(FILE **)C;
  if(!isAssign)xPrintString("I/O on ");
  isAssign = 0;
  if (temp == stdin) strcpy(yCTemp_TextFile,"stdin");
  else if (temp == stdout)strcpy(yCTemp_TextFile,"stdout");
  else if (temp == stderr)strcpy(yCTemp_TextFile,"stderr");
  else if (temp == NULL) strcpy(yCTemp_TextFile,"NULL");
  else {
    while (i<NFiles && FilePtr[i]!=temp) i++;
    if (i<FOPEN_MAX)
      strcpy(yCTemp_TextFile, NameOfFile[i]);
    else
      return NULL;
  }
  return yCTemp_TextFile;
}
