SDL_Boolean AtLastChar(TextFile F)
{
  char testbuf[2];
#ifdef XOPERRORF
  if (F == TextFileNull()) {
    xSDLOpError("AtLastChar in sort TextFile",
                "TextFile parameter is NULL");
    return 1;
  }
#endif
  if (!F)
    return 1;
  if (pfread (F, testbuf, 1, ftell(F)) < 1)
    return SDL_True;
  else
    return SDL_False;
}


